import React from "react";
import { useNavigate } from "react-router-dom";
import { Link } from "react-router-dom";
import { useState } from "react";
import ManagerProjectTable from "./ManagerProjectTable";
import { useParams } from "react-router-dom";

const ManagerPage = () =>{
    const navigate = useNavigate();
    const[showManagerProjectTable, setShowManagerProjectTable] = useState(false);

   return(
    <React.Fragment>
         <div className="navbar">
            <Link to="/" className="links">Task Management System</Link>
           
            <a href="#about" className="links">About Us</a>
           
            <a href="#contact" className="links">Contact Us</a>
            <div className="navbarTwo">
            <Link to ="/myProjects" className ="links" onClick={() =>{setShowManagerProjectTable(true)}}>My Projects</Link>
            <Link to="/registerEmployee" className ="links">Register Employee</Link>
            <Link to ="/viewAllEmployees" className="links">View All Employees</Link>
            <Link to ="/changePassword" className="links">Change Password</Link>
            <Link to="/logout" className="links">Logout</Link>
            </div>
        </div>

        {showManagerProjectTable && (<ManagerProjectTable />)}
    </React.Fragment>
   )

}

export default ManagerPage;
